webpackJsonp([0x7af4e6fc7393],{550:function(e,t){e.exports={data:{authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{nodes:[{node:{frontmatter:{title:"Overcoming Setbacks",tags:["A Year of Apps"],cover:"https://unsplash.it/1152/300/?random?Setbacks",date:"2016-01-26T22:26",author:"eddie"},fields:{slug:"/overcoming-setbacks"},html:'<p>Writing the opening post for this <em>"a year of apps"</em> series I had what I would have previously treated as an unrecoverable setback. I lost the post.</p>\n<p>After spending 20 minutes crafting the perfect post in the Tumblr iOS app, I decided to put it down, think it over, and make a cup of tea before posting. In the interim I used a few other apps, and when I returned the app had reset and the post was gone.</p>\n<p>Forcing myself to writing the post again (all be it a lot shorter) and not giving up with the challenge can only be a good sign of things to come.</p>',timeToRead:1}},{node:{frontmatter:{title:"A Year of Apps",tags:["A Year of Apps"],cover:"https://unsplash.it/1152/300/?random?Apps",date:"2016-01-26T22:20",author:"eddie"},fields:{slug:"/a-year-of-apps"},html:'<p><img src="/images/year-of-apps.jpg" alt="A Year of Apps"></p>\n<p>I’ve set myself a challenge for 2016; I will complete 12 projects.</p>\n<p>In previous years I’ve started countless apps, games and websites, none of which ever see the light of day. This year I aim to ship a project like this every month. The apps for January and February are well underway - so we’re off to a good start.</p>\n<p>Lets see where this goes...</p>',timeToRead:1}},{node:{frontmatter:{title:"Lauren and me",tags:["family","personal"],cover:"https://unsplash.it/1152/300/?random?Love",date:"2015-04-19T08:02",author:"eddie"},fields:{slug:"/lauren-and-me"},html:'<p><img src="/images/lauren-me.jpg" alt="Lauren and me"></p>',timeToRead:1}},{node:{frontmatter:{title:"Star Wars: The Force Awakens Official Teaser #2",tags:["Star Wars","The Force Awakens"],cover:"https://unsplash.it/1152/300/?random?ForceAwakens",date:"2015-04-16T19:32",author:"eddie"},fields:{slug:"/star-wars-the-force-awakens-official-teaser-2"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.2%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://www.youtube.com/embed/ngElkyQ6Rhs" frameborder="0" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>',timeToRead:1}},{node:{frontmatter:{title:"RIP Leonard Nimoy",tags:["quote post","The Simpsons","Star Trek","Leonard Nimoy"],cover:"https://unsplash.it/1152/300/?random?StarTrek",date:"2015-02-28T00:25",author:"eddie"},fields:{slug:"/rip-leonard-nimoy"},html:'<p><img src="/images/rip-nimoy-1.png" alt="Hello. I&#x27;m Leonard Nimoy."></p>\n<p><img src="/images/rip-nimoy-2.png" alt="The following tale of alien encounters is true."></p>\n<p><img src="/images/rip-nimoy-3.png" alt="And by true, I mean false."></p>\n<p><img src="/images/rip-nimoy-4.png" alt="It&#x27;s all lies. But they&#x27;re entertaining lies."></p>\n<p><img src="/images/rip-nimoy-5.png" alt="And in the end, isn&#x27;t that the real truth?"></p>',timeToRead:1}}],page:7,pages:10,total:49,limit:5,prev:"/6",next:"/8"}}}});
